import React from "react";
import About from "./About";
import Contact from "./Contact";
import Home from "./Home";
import Service from "./Service";
import { Switch } from 'react-router-dom';


const App = () => {
    return (
        <>
        <Switch>
            <Home />
            <About />
            <Contact />
            <Service />
        </Switch>

        </>
    );

}

export default App;
